import React from 'react';
import Carousel from 'react-bootstrap/Carousel'

const ImgCarousel = (props) =>{

    return(
        <Carousel>
            {props.images.map((image, index)=>(
                <Carousel.Item>
                    <img class='carousel-img' src={image}></img>
                </Carousel.Item>
            ))}
        </Carousel>
    );

}

export default ImgCarousel
